import React from 'react'
import Link from 'next/link'

export class Company extends React.Component {
    componentDidMount() {
      this.props.store.start()
    }

    componentWillUnmount() {
      this.props.store.stop()
    }

    render() {
        return (
            <div>
            Hi i am component
            </div>
        )
    }
}
